		 * |  %g  | Green (dark)
		 * |  %b  | Blue (dark)
		 * |  %r  | Red (dark)
		 * |  %m  | Magenta (dark)
		 * |  %c  | Cyan (dark)
		 * |  %w  | White (dark) (light gray)
		 * |  %k  | Black
		 * |  %Y  | Yellow (bright)
		 * |  %G  | Green (bright)
		 * |  %B  | Blue (bright)
		 * |  %R  | Red (bright)
		 * |  %M  | Magenta (bright)
		 * |  %C  | Cyan (bright)
		 * |  %W  | White
		 * |  %K  | Black (bright) (dark gray)
